import React from "react";
import { useState } from "react";
import Dropdown from "./Dropdown";
import { options, nairobi } from "./Options";
import "./styles.css";
import $ from "jquery";
const Search = () => {
  const [skill, setSkill] = useState(options[0]);
  const [location, setLocation] = useState(nairobi[0]);
  const handleSkillSelect = (seletedSkill) => {
    setSkill(seletedSkill);
  };
  const handleLocationSelect = (seletedlocation) => {
    setLocation(seletedlocation);
  };
  const searchDB = (e) => {
    e.preventDefault();
    console.log("piki ponky");
    $.ajax({
      url: "/profile/search", //TODO: update request URL
      type: "POST",
      dataType: "json",
      contentType: "application/json",
      data: JSON.stringify({
        location: location,
        skill: skill,
      }),
      xhrFields: {
        withCredentials: true,
      },
      crossDomain: true,
      success: (result) => {
        return;
      },
      error: (error) => {
        alert("Unable to load question. Please try your request again");
        return;
      },
    });
  };
  return (
    <div className="searchbar">
      <form onSubmit={(e) => searchDB()}>
        <Dropdown
          label="location"
          selected={location}
          onSelectedChange={handleLocationSelect}
          options={nairobi}
        />
        <Dropdown
          label="service"
          selected={skill}
          onSelectedChange={handleSkillSelect}
          options={options}
        />
        <input type="submit" value="search" />
      </form>
    </div>
  );
};
export default Search;
